import React from 'react'
import './';
import logo from '../../assects/navlogoAY.png';
import { Link } from 'react-scroll';

const Navbar = () => {
    return (
        <nav className='navbar'>
            <img src={logo} alt='Logo' className='logo' />
            <div className='desktopMenu'>
                <Link className="desktopMeanuListItem">Home</Link>
                <Link className="desktopMeanuListItem">About</Link>
                <Link className="desktopMeanuListItem">Client</Link>
                <Link className="desktopMeanuListItem">Review</Link>

            </div>
            <button className='desktopMenuBtn'>
                <img src='' alt='' className='desktopMenuImg' />Contact Me
            </button>

        </nav>
    );
}

export default Navbar
